mongodb aggregation with multiple sub groups<p>I have a collection with documents that look similar to this:</p>

<pre><code>[
    {
        "_id": ObjectId("..."),
        "date": ISODate("..."),
        "type": "TypeA",
        "color": "ColorA",
        "soldFor": 12.15
    },
    {
        "_id": ObjectId("..."),
        "date": ISODate("..."),
        "type": "TypeA",
        "color": "ColorB",
        "soldFor": 13.15
    },
    {
        "_id": ObjectId("..."),
        "date": ISODate("..."),
        "type": "TypeB",
        "color": "ColorA",
        "soldFor": 12.15
    },
    {
        "_id": ObjectId("..."),
        "date": ISODate("..."),
        "type": "TypeB",
        "color": "ColorB",
        "soldFor": 12.15
    }
]
</code></pre>

<p>I know that this is not a good way to store such information, but unfortunately I have no influence in that.
What I need to get out of the collection is something like this:</p>

<pre><code>[
    2017: {
        typeA: {
            colorA: {
                sum: 125.00
            },
            colorB: {
                sum: 110.00
            }            
        },
        typeB: {
            colorA: {
                sum: 125.000
            }
        }        
    },
    2016: {
        typeA: {
            colorB: {
                sum: 125.000
            }
        }
    }
]
</code></pre>

<p>At the moment I have two group stages that give me everything grouped by year, but I have no clue how to get the two other sub-groups. Building the sum would be a nice to have, but I am certain that I can figure out how that would be done in a group.</p>

<p>So far my pipeline looks like this:</p>

<pre><code>[
    {
      $group: {
        _id: { type: '$type', color: '$color', year: { $year: '$date' } },
        docs: {
          $push: '$$ROOT'
        }
      }
    },
    {
      $group: {
        _id: { year: '$_id.year' },
        docs: {
          $push: '$$ROOT'
        }
      }
    }
]
</code></pre>

<p>which results in something like this:</p>

<pre><code>[
    {
        "_id": {
            "year": 2006
        },
        "docs": {
            "_id": {
                "type": "typeA",
                "color": "colorA",
                "year": 2006
            },
            "docs": [
                {
                    ... root document
                }
            ]
        }
    },
    {
        "_id": {
            "year": 2016
        },
        "docs": [
            {
                "_id": {
                    "type": "typeA",
                    "color": "colorB",
                    "year": 2016
                },
                "docs": [
                    {
                        ... root document
                    }
                ]
            }
            ... more docs with three keys in id
        ]
    }
]
</code></pre>

<p>Help is much appreciated!</p>

