<p>Even the following simplified count query gets executed in 312 ms instead of few time:</p>

<pre><code>db.production_units.aggregate([{
        "$unwind": "$workers"
    }, {
        "$unwind": "$workers.tasks"
    },
    {
        "$count": "entries_count"
    }
])
</code></pre>

<p>This is what <code>explain()</code> returns for the query above:</p>

<pre><code>{
    "stages" : [
        {
            "$cursor" : {
                "query" : {

                },
                "fields" : {
                    "workers" : 1,
                    "_id" : 0
                },
                "queryPlanner" : {
                    "plannerVersion" : 1,
                    "namespace" : "my_db.production_units",
