NodeJS: Send Response after MongoDB Document has been updated or created<p>I have a nodeJS server which maintains a MongoDB and a client which sends a post request with a buildName variable in JSON. </p>

<p>What I am trying to do is setup an event listener that is triggered when the mongoDB document with a field matching the buildName sent by the client is updated or created. Multiple clients can be listening and must be notified if a document containing the same buildName that they pass in is updated or created.</p>

<p>I have tried to do polling with this method where my client just sat in a while loop and constantly asked if there was an update, however, I ran into performance issues so I switched to event listeners. </p>

<p>I tried a few different ways of setting up a callback when my client sends its post request which gets called whenever a document is updated and then sends that updated mongodb doc as a <code>res.json</code>. One of the ones I am using is mongoose-trigger npm module which allows me to setup event listeners for both creates and updates.</p>

<p>I also looked on here for possible solutions which brought me to <a href="https://www.npmjs.com/package/mongoose-trigger" rel="nofollow noreferrer">mongoose-trigger</a> for getting events triggered on creates and updates, but still could not find an answer that satisfied using this triggering to fire off a response to a post request. </p>

<p>Here is a snippet of the code for creating the triggering event object:</p>

<pre><code>10 const Events = trigger(buildSchema, {
 11   events: {
 12     create: {
 13       select: 'logFile'
 14     },
 15     update: {
 16       select: 'logFile'
