MongoDB get distinct elements from array WITH count of occurrences of each element<p>I have the following documents in my collection. Each document contains the text of a tweet and an array of entities picked out of the tweet (with AWS Comprehend): </p>

<pre><code>{
"text" : "some tweet by John Smith in New York about Stack Overflow",
"entities" : [
    {
        "Type" : "ORGANIZATION",
        "Text" : "stack overflow"
    },
    {
        "Type" : "LOCATION",
        "Text" : "new york"
    },
    {
        "Type" : "PERSON",
        "Text" : "john smith"
    }
  ]
},
{
    "text" : "another tweet by John Smith but this one from California and about Google",
    "entities" : [
    {
        "Type" : "ORGANIZATION",
        "Text" : "google"
    },
    {
        "Type" : "LOCATION",
        "Text" : "california"
    },
    {
        "Type" : "PERSON",
        "Text" : "john smith"
    }
  ]
}
</code></pre>

<p>I would like to get a list of distinct <code>entities.Text</code>, grouped by <code>entities.Type</code> WITH a count of the occurrences of each <code>entities.Text</code> like so:</p>

<pre><code>{ "_id" : "ORGANIZATION", "values" : [ {text:"stack overflow",count:1},{text:"google",count:1} ] }
{ "_id" : "LOCATION", "values" : [ {text:"new york",count:1},{text:"california",count:1} ] }
{ "_id" : "PERSON", "values" : [ {text:"john smith",count:2} ] }
</code></pre>

<p>I've can group by <code>entities.Type</code> and put ALL the <code>entities.Text</code> into an array with this query:</p>

<pre><code>db.collection.aggregate([
{
    $unwind: '$entities'
}, 
{
    $group: {
        _id: '$entities.Type',
        values: {
            $push: '$entities.Text'
    }
}
}])
</code></pre>

<p>which results in this output that includes duplicate values and no count.</p>

<pre><code>{ "_id" : "ORGANIZATION", "values" : [ "stack overflow", "google" ] }
{ "_id" : "LOCATION", "values" : [ "new york", "california" ] }
{ "_id" : "PERSON", "values" : [ "john smith", "john smith" ] }
</code></pre>

<p>I began going down the path of using <code>$project</code> as the last step of the aggregation and adding a calculated field <code>valuesMap</code> with a javascript function. But then I realized that you cannot write javascript in the aggregation pipeline.</p>

<p>My next step will be to process the mongoDB output using plain javascript but I was hoping (for learnings sake) to get this all done using a mongoDB query.</p>

<p>Thanks!</p>

